import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import PrmNavBar from "./PrmNavBar";
import { TextareaAutosize } from "@material-ui/core";

class ADCU_metrics extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div class="prm-background">
        <PrmNavBar></PrmNavBar>
            <h1 style={{textAlign:"center", color:"#0FA3B1"}}>Analysis Stories for ADC420HA22</h1>
        
      </div>
    );
  }
}

export default ADCU_metrics;
